import { StyleSheet, Text, View } from 'react-native';

export default function App() {
  return (

      <View style={styles.header}>
        <Text>Шапка</Text>
      <Text>Привет!</Text>
      <StatusBar style="auto" />
      </View>

  );
}

const styles = StyleSheet.create({
  container: {
    paddingTop: '13%',
    backgroundColor: 'rgb(22, 50, 89)',
    height: '100%',
  },
  heading: {
    fontSize: 30,
    textAlign: 'center',
    fontWeight: '700',
    marginBottom: '10%',
    color: 'rgb(241, 50, 40)',
  },
})
